const FormLog=()=> {
  return(
    <div>
      <h1>Enter the password</h1>
  <form action="#">
  <input type="password" placeholder="Password" /> <br/> <br/>
  <input type="submit"  value="submit"/>
  </form>

  <ul>
          <li>
          client@example.com
          </li>
          <li>
          555.555.5555
          </li>
        </ul>
  </div>);
}
function App() {
